  Hint: Data Source
  Value: reporting
- ID: "a61cc636-3272-4fb6-bcf9-762940047a78"
  Hint: Query
  Value: |
    select top 25 
    	[FailureDetails].[PreviousUrl],
    	COUNT(*) as [UrlTotal]
    from [Fact_Failures], [FailureDetails]
    where [Fact_Failures].[FailureDetailsId] = [FailureDetails].[FailureDetailsId] 
       AND [FailureDetails].[Url] = @PageUrl
       AND  [Fact_Failures].[Date] BETWEEN @StartDate AND @EndDate
    group by
    	[FailureDetails].[PreviousUrl]
    order by 
    	[UrlTotal] desc
